import UIKit

class UnderConstructionImageView: UIImageView {
    init() {
        super.init(frame: .zero)
        translatesAutoresizingMaskIntoConstraints = false

        loadImages()
    }

    required init?(coder: NSCoder) {
        super.init(coder: coder)
        loadImages()
    }

    private func loadImages() {
        accessibilityLabel = "Under Construction"

        DispatchQueue(label: "com.cocoatype.UnderConstructionImageView.loadImages").async {
            let images = Self.imageDatas.compactMap(UIImage.init(data:))
            let animatedImage = UIImage.animatedImage(with: images, duration: 1)

            DispatchQueue.main.async { [weak self] in
                self?.image = animatedImage
            }
        }
    }

    // MARK: Data

    private static let imageDatas = base64Strings.compactMap { Data(base64Encoded: $0) }
    private static let base64Strings = [
        "",
        "",
        "",
        "",
        "",
        ""
    ]
}
